    public static void send() {
        // 请求url
        String url = "http://192.168.0.155:9999/hz2004query/getRxbd";
        HttpPost post = new HttpPost(url);
        post.addHeader("Content-Type", "application/json;charset=UTF-8");
        try {
            //封装参数
            String requestDate = sendJson();
            post.setEntity(new StringEntity(requestDate, "UTF-8"));
            CloseableHttpClient httpClient = HttpClientBuilder.create().build();
            HttpResponse response1 = httpClient.execute(post);
            StringBuilder responstContent = new StringBuilder();
            if (response1 != null) {
                InputStream inputStream = response1.getEntity().getContent();
                BufferedReader in = new BufferedReader(new InputStreamReader(inputStream, "UTF-8"));
                String line;
                while ((line = in.readLine()) != null) {
                    responstContent.append(line);
                    String property = System.getProperty("line.separator");
                    responstContent.append(property);
                }
            }
        } catch (Exception e) {
            // TODO Auto-generated catch block
            e.printStackTrace();
        }
    }

